import React, { useState } from "react";
import "tailwindcss/tailwind.css";
import github from "/./icons/github.png"; 
import behance from "/./icons/behance.png";
import gmail from "/./icons/gmail.png";
import linkedin from "/./icons/linkedin.png";
import medium from "/./icons/medium.png";

function Terminal() {
  const [command, setCommand] = useState("");
  const [output, setOutput] = useState("");
  const [welcomeMessage, setWelcomeMessage] = useState(
    "Welcome to my portfolio! To start exploring this Terminal type <i>help</i> then press enter. Note that the Tab Key helps you complete the commands."
  );

  function handleCommand(e) {
    e.preventDefault();
    switch (command.toLowerCase()) {
      case "about":
        setOutput("- about : learn more about me");
        break;
      case "contact":
        setOutput(
          <>
            <img src={gmail} alt="Mail Icon" className="inline" /> staili.fatimazohra@gmail.com
          </>
        );
        break;
      case "socials":
        setOutput(
          <>
            <img src={linkedin} alt="LinkedIn Icon" className="inline" />{" "}
            <a href="https://www.linkedin.com/in/fatima-zohra-staili-681878200/" target="_blank" rel="noopener noreferrer">
              Linkedin
            </a>
            <br />
            <img src={medium} alt="Medium Icon" className="inline" />{" "}
            <a href="https://medium.com/@staili.fatimazohra" target="_blank" rel="noopener noreferrer">
              Medium
            </a>
            <br />
            <img src={behance} alt="Behance Icon" className="inline" />{" "}
            <a href="https://www.behance.net/fatimastaili" target="_blank" rel="noopener noreferrer">
              Behance
            </a>
          </>
        );
        break;
      case "help":
        setOutput(`
          - ${"about".padEnd(9, ' ')}: learn more about me
          - ${"contact".padEnd(9, ' ')}: get my e-mail address
          - ${"socials".padEnd(9, ' ')}: how to contact me online
          - ${"education".padEnd(9, ' ')}: my academic journey
          - ${"experience".padEnd(9, ' ')}: display the list of my work experiences
          - ${"projects".padEnd(9, ' ')}: display the list of my projects
          - ${"hobbies".padEnd(9, ' ')}: know more about what I like
          - ${"clear".padEnd(9, ' ')}: clear terminal
          - ${"get cv".padEnd(9, ' ')}: download my cv
        `);
        break;
      default:
        setOutput("Unknown command. Type 'help' for a list of available commands.");
    }
    setCommand("");
  }

  function handleChange(e) {
    setCommand(e.target.value);
  }

  return (
    <div className="bg-black h-screen w-screen flex justify-center items-center">
      <div className="bg-gray-900 text-white text-center flex flex-col rounded-lg w-2/3 h-3/4">
      <div className="bg-gray-700 p-2 rounded-t-lg flex items-center justify-between">
          <div className="flex space-x-2">
            <div className="text-yellow-500">&#x25CF;</div>
            <div className="text-red-500">&#x25CF;</div>
          </div>
          <div className="text-gray-300">~/Portfolio/Terminal/STAILI</div>
          <div className="text-red-500 cursor-pointer">&#x2716;</div>
        </div>
        <div className="bg-gray-800 p-2 flex">
          <div className="text-gray-300 flex">
            <span className="mr-2">File</span>
            <span className="mr-2">|</span>
            <span className="mr-2">Actions</span>
            <span className="mr-2">|</span>
            <span className="mr-2">Edit</span>
            <span className="mr-2">|</span>
            <span className="mr-2">View</span>
            <span className="mr-2">|</span>
            <span className="italic">Help</span>
          </div>
        </div>
        <div className="flex-grow bg-gray-800 p-4">
          <div className="mb-6" dangerouslySetInnerHTML={{ __html: welcomeMessage }}></div>
          <form onSubmit={handleCommand} className="flex">
            <div className="mr-2 text-blue-600 font-mono self-end">visitor@terminal.staili : ~$</div>
            <input
              type="text"
              value={command}
              onChange={handleChange}
              className="flex-grow bg-transparent text-white focus:outline-none border-b-2 border-green-500 font-mono"
            />
          </form>
          {output && (
            <div className="mt-2">
              <pre>{output}</pre>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}
export default Terminal;
